import React, { useState } from "react";

export default function Accinput(){
    const [accomodation,setAccomodation]=useState({
        name:"",
        category:"",
        type:"",
        tv:true,
        safe:true,
        fridge:true,
        ac:true,
        internet:true,
        location:{
            city:"",
            country:"",
            continent:""
        }
    });

    const updateName=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,name:(e.target.value)}
        })
    }
    const updateCategory=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,category:(e.target.value)}
        })
    }
    const updateType=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,type:(e.target.value)}
        })
    }
    const updateTv=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,tv:(e.target.value)}
        })
    }
    const updateSafe=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,safe:(e.target.value)}
        })
    }
    const updateFrifge=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,fridge:(e.target.value)}
        })
    }
    const updateAc=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,ac:(e.target.value)}
        })
    }
    const updateInternet=(e)=>{
        setAccomodation(previousData=>{
            return{...previousData,internet:(e.target.value)}
        })
    }
    const updateCity=(e)=>{
        setAccomodation(previousData=>({...previousData,location:{...previousData,city:(e.target.value)}}));
    }
    const updateCountry=(e)=>{
        setAccomodation(previousData=>({...previousData,location:{...previousData,country:(e.target.value)}}));
    }
    const updateContinent=(e)=>{
        setAccomodation(previousData=>({...previousData,location:{...previousData,continent:(e.target.value)}}));
    }
    return(
        <div className="row my-5 p-2" style={{borderTop:"solid"}}>
            <div className="col-md-5">
                <label className="form-label my-1" htmlFor="name">Naziv smestajnog objekta:</label>
                <input className="form-control" 
                    type="text" 
                    id="name" 
                    name="name"
                    value={accomodation.name}
                    onChange={updateName}
                    style={{borderRadius:'20px'}}></input>
                <label className="form-label my-1" htmlFor="category">Kategorija smestaja:</label>
                <input className="form-control" 
                    type="text" 
                    id="category" 
                    name="category"
                    value={accomodation.category}
                    onChange={updateCategory}
                    style={{borderRadius:'20px'}}></input>
                <label htmlFor="type" className="form-label my-1">Tip smestaja:</label>
                <br></br>
                <select className="text-wrap" value={accomodation.type} name="type" onChange={updateType} style={{borderRadius:'20px',height:"30px"}} required>
                    <option value="Hotelski">Hotelski</option>
                    <option value="Bungalov">Bungalov</option>
                    <option selected value="">...</option>
                </select>
                <div className="row">
                    <div className="col-md-4">
                        <label htmlFor="internet" className="form-label my-1">Internet:</label>
                        <br></br>
                        <select className="text-wrap text-center" value={accomodation.internet} name="internet" onChange={updateInternet} style={{borderRadius:'20px',height:"30px",width:"75px"}} required>
                            <option selected value={true}>Da</option>
                            <option value={false}>Ne</option>
                        </select>
                    </div>
                    <div className="col-md-4">
                        <label htmlFor="tv" className="form-label my-1">TV:</label>
                        <br></br>
                        <select className="text-wrap text-center" value={accomodation.tv} name="tv" onChange={updateTv} style={{borderRadius:'20px',height:"30px",width:"75px"}} required>
                            <option selected value={true}>Da</option>
                            <option value={false}>Ne</option>
                        </select>
                    </div>
                    <div className="col-md-4">
                        <label htmlFor="ac" className="form-label my-1">Klima:</label>
                        <br></br>
                        <select className="text-wrap text-center" value={accomodation.ac} name="ac" onChange={updateAc} style={{borderRadius:'20px',height:"30px",width:"75px"}} required>
                            <option selected value={true}>Da</option>
                            <option value={false}>Ne</option>
                        </select>
                    </div>
                    <div className="row justify-content-around">
                        <div className="col-md-4">
                            <label htmlFor="fridge" className="form-label my-1">Frizider:</label>
                            <br></br>
                            <select className="text-wrap text-center" value={accomodation.fridge} name="fridge" onChange={updateFrifge} style={{borderRadius:'20px',height:"30px",width:"75px"}} required>
                                <option selected value={true}>Da</option>
                                <option value={false}>Ne</option>
                            </select>
                        </div>
                        <div className="col-md-4">
                        <label htmlFor="safe" className="form-label my-1">Sef:</label>
                        <br></br>
                        <select className="text-wrap text-center" value={accomodation.safe} name="safe" onChange={updateSafe} style={{borderRadius:'20px',height:"30px",width:"75px"}} required>
                            <option selected value={true}>Da</option>
                            <option value={false}>Ne</option>
                        </select>
                    </div>
                    </div>
                </div>
                <label htmlFor="remark" className="form-label my-1">Komentar:</label>
                <br></br>
                <textarea value={arrangement.remark} name="remark" onChange={updateRemark} rows={5} cols={10} style={{borderRadius:'10px',height:"180px",width:"400px"}} required/>
        </div>
        </div>
    );
}
